import React from "react";
import "../styles/styles.css";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Navbar from "../components/Navbar";
import HeroBanner from "../components/HeroBanner";


export default function Contact() {
    return (

        <>

            <Navbar />
            <main>
                <div>
                    <div style={{ width: "100%", height: "600px" }}>
                        <span>문의하기</span>
                        <span>리플하다에게 문의 주시면 언제나 친절히 답변해드리겠습니다</span>
                        <span>아래 문의하기를 선택해 주세요</span>
                    </div>
                </div>
                <div>
                    <div>
                        <span>전화문의</span>
                        <span>010</span>
                    </div>
                    <div>
                        <span>이메일문의</span>
                        <span>010</span>
                    </div>
                    <div>
                        <span>주소</span>
                        <span>010</span>
                    </div>

                </div>
                <div>
                    <span>혹은, 메세지를 남겨주세요</span>
                </div>

                <div>
                    <div>
                        {/* 이름 */}
                        {/* 텍스트필드 */}
                    </div>
                    <div>
                        {/* 이메일주소 */}
                        {/* 텍스트필드 */}
                    </div>
                    <div>
                        {/* 연락처 */}
                        {/* 텍스트필드 */}
                    </div>
                    <div>
                        {/* 제목 */}
                        {/* 텍스트필드 */}
                    </div>
                    <div>
                        {/* 내용 */}
                        {/* 텍스트필드 */}
                    </div>
                    {/* 버튼 */}
                </div>
            </main>
        </>
    );
}
